/*!

* Coded by Gregory Moncayo

=========================================================

* The above is copyright by ToUpper LLC.

*/
import React from "react";

// react component that copies the given text inside your clipboard
import { CopyToClipboard } from "react-copy-to-clipboard";
// reactstrap components
import {
  Card,
  CardHeader,
  CardBody,
  Container,
  Row,
  Col,
  UncontrolledTooltip,
  CardImg, CardText,
  CardTitle, CardSubtitle, Button, CardImgOverlay,Image
} from "reactstrap";
// core components
import Header from "components/Headers/Header.jsx";
import krazyball from "/Users/gregorymoncayo/Desktop/ToUpper LLC/WebSite/src/assets/img/brand/football.png";

class Icons extends React.Component {
  state = {};
  render() {
    return (
      <>
        <Header />
        {/* Page content */}

        <Container className=" mt--7" fluid>
          {/* Table */}
          <Row>
    <Col xs={6} md={4}>
      <Image src={krazyball} />
    </Col>
    <Col xs={6} md={4}>
      <Image src="holder.js/171x180" roundedCircle />
    </Col>
    <Col xs={6} md={4}>
      <Image src="holder.js/171x180" thumbnail />
    </Col>
  </Row>
          </Container>
      </>
    );
  }
}

export default Icons;
